const References = () => {
  return (
    <section id="references-content">
      <h3>References</h3>
      <table>
        <thead>
          <tr>
            <th>S.No</th>
            <th>References</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>1</td>
            <td>K. Alanezi and S. Mishra "<a href="https://ieeexplore.ieee.org/abstract/document/9864183" target="_blank">Utilizing Microservices Architecture for Enhanced Service Sharing in IoT Edge Environments</a>" in <i>IEEE Access</i>, vol. 10, 2022.</td>
          </tr>
          {/* Add other references */}
        </tbody>
      </table>
    </section>
  );
};

export default References;
